  return (
    <>
      {db.results.map((item) => (
        <>
          <CreateCard key={item.id} id={item.id} name={item.title} />
          <GetPicture />
        </>
      ))}
    </>
  );
}

function CreateCard(props) {
  return (
    <li className="item">
      {props.id}
      {props.name}
    </li>
  );
}

